import {Test} from "../styled-components/Test.style"
import {AppContainer} from '../styled-components/Container.style'
function App() {
  return (
    <AppContainer>
      <Test backgroundColor = "blue"/>
      <Test backgroundColor = "red"/>
      <Test backgroundColor = "green"/>
    </AppContainer>
  );
}

export default App;
